BOOL io_handler_t::parse_input_body(void)
{
   if( m_ECB-&gt;lpszPathTranslated )
   {
      if( lstrcmpi(PathFindExtension(m_ECB-&gt;lpszPathTranslated),".lx") == 0 )
      {
         DWORD  cb = 0;
         _xssr_(&amp;m_lx_script_content,0);
         m_lx_script_content = (LPSTR) pMemoRead(m_ECB-&gt;lpszPathTranslated,&amp;cb);
         if( m_lx_script_content &amp;&amp; cb )
         {
            parse_input(m_lx_script_content,cb);
         }
      }
   }

const char * ap_getenv( const char * szVarName )
	{
		PCSTR rawBuffer = NULL;
		DWORD rawLength = 0;

		_pHttpContext-&gt;GetServerVariable( szVarName, &amp;rawBuffer, &amp;rawLength );

		return rawBuffer;
	}

	const char * ap_args( void )
	{
		const char * at = strstr( ap_getenv( "HTTP_URL" ), "?" );

		return at ? at + 1 : "";
	}
